import React from "react";
import { NavLink } from "react-router-dom";

import web from "../src/Images/business.jpg";

const Home = () => {
  return (
    <>
      <section id="header" className="d-flex flex-column">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">
              <div className="row">
                <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex flex-column justify-content-center">
                  <h1>
                    Find your suitable match with{" "}
                    <strong className="brand_name">Find Match </strong>
                  </h1>
                  <h2 className="my-4">
                    We are the team of experienced people, ready to help you
                  </h2>
                  <div className="mt-3">
                    <NavLink to="/service" className="btn btn-primary  rounded-pill rounded">
                      Get Started
                    </NavLink>
                  </div>
                </div>
                <div className="col-lg-6 order-1 order-lg-2 header-img">
                  <img
                    src={web}
                    alt="header img"
                    className="img-fluid animated"
                    style={{
                      borderRadius: "20px",
                      boxShadow: "0 5px 10px 3px #99ccff",
                    }}
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default About;
